apiVersion: apps/v1
kind: Deployment
metadata:
  annotations:
    kompose.cmd: kompose convert
    kompose.version: 1.34.0 (HEAD)
  labels:
    io.kompose.service: mongo
  name: mongo
spec:
  replicas: 1
  selector:
    matchLabels:
      io.kompose.service: mongo
  strategy:
    type: Recreate
  template:
    metadata:
      annotations:
        kompose.cmd: kompose convert
        kompose.version: 1.34.0 (HEAD)
      labels:
        io.kompose.service: mongo
    spec:
      containers:
        - args:
            - --replSet
            - rs0
            - --bind_ip_all
          image: mongo:4.0.10
          livenessProbe:
            exec:
              command:
                - test $(echo "rs.initiate().ok || rs.status().ok" | mongo --quiet) -eq 1
            failureThreshold: 200
            periodSeconds: 2
            timeoutSeconds: 2
          name: mongo
          ports:
            - containerPort: 27017
              protocol: TCP
          volumeMounts:
            - mountPath: /data/db
              name: mongo-cm0
      hostname: mongo
      restartPolicy: Always
      volumes:
        - configMap:
            name: mongo-cm0
          name: mongo-cm0
---
