apiVersion: apps/v1
kind: Deployment
metadata:
  annotations:
    kompose.cmd: kompose convert
    kompose.version: 1.34.0 (HEAD)
  labels:
    io.kompose.service: essyncer
  name: essyncer
spec:
  replicas: 1
  selector:
    matchLabels:
      io.kompose.service: essyncer
  strategy:
    type: Recreate
  template:
    metadata:
      annotations:
        kompose.cmd: kompose convert
        kompose.version: 1.34.0 (HEAD)
      labels:
        io.kompose.service: essyncer
    spec:
      containers:
        - env:
            - name: DB_NAME
              value: erxes
            - name: ELASTICSEARCH_URL
              value: http://elasticsearch:9200
            - name: MONGO_URL
              value: mongodb://mongo:27017/erxes?replicaSet=rs0
          image: erxes/essyncer:dev
          name: essyncer
          tty: true
          volumeMounts:
            - mountPath: /data/essyncerData
              name: essyncer-claim0
            - mountPath: /var/log/mongo-connector
              name: essyncer-claim1
      restartPolicy: Always
      volumes:
        - name: essyncer-claim0
          persistentVolumeClaim:
            claimName: essyncer-claim0
        - name: essyncer-claim1
          persistentVolumeClaim:
            claimName: essyncer-claim1
